import React from 'react';
import './Card.css';

const Card = (props) => {
	return (
		<div className='cards bg-white'>
			{/* <img  style={{width: '40%', height: '100%'}} alt='photos'src={props.image}/> */}
			<img alt='photos'src={props.image}/>
			<div className="cardDesc">

				<h2>{props.name}</h2>
				<p> {props.faction} </p>
				<p> {props.description} </p>
				<p> {props.weight} </p>

			</div>
		</div>
		);
}

export default Card;
